import React from 'react';
import {connect} from "react-redux";
import {compose} from "redux";
import Buy from "./Buy";


class LastSeenContainer extends React.Component {


    render() {
        var result = this.props.item.filter(function (v) {
            return this.props.item.some(function (v2) {
                return v.id == v2.id && v.item == v2.item;
            })
        })


        return (

            <Buy item={result} updateamout={this.props.updateamout}/>
        )
    }
}


let mapStateToprops = (state) => {

    return {
        item: state.BuyPage.item


    }


}

export default compose(
    connect(mapStateToprops, {}),
)(LastSeenContainer)
